import React from "react";
import Nav from "./Nav";
import RandomData from "./RandomData";
import "./TagPage.css";

//break into smaller components
//think about passing data state around
//controlled components for inputs and filter by tag

export default function TagPage({ page, setPage }) {
  return (
    <>
      <Nav page={page} setPage={setPage}></Nav>
      <RandomData></RandomData>
      <div className="existing-tags-container">
        <label>Existing Tags:</label>
        <ul id="tag-div"></ul>
      </div>
      <div className="new-tags-container">
        <button id="add-tag-btn">Add tag</button>
        <div id="add-tags-container"></div>
      </div>
      <button id="update-tags-btn">Update Tags</button>
    </>
  );
}
